(3,	35,	'Messages',	'messages',	'',	'<p>Joomla! offers three different types of messages. Creatings standard information about Joomla! system is presented depending on a message type as follows:</p>\r\n<p>\r\n<dl id=\"system-message\"><dt class=\"error\">Error</dt><dd class=\"message message fade\"> \r\n<ul>\r\n<li>This is a sample message</li>\r\n</ul>\r\n</dd></dl> \r\n</p>\r\n<p>\r\n<dl id=\"system-message\"><dt class=\"error\">Error</dt><dd class=\"notice message fade\"> \r\n<ul>\r\n<li>This is a sample warning message</li>\r\n</ul>\r\n</dd></dl> \r\n</p>\r\n<p>\r\n<dl id=\"system-message\"><dt class=\"error\">Error</dt><dd class=\"error message fade\"> \r\n<ul>\r\n<li>This is a sample error message</li>\r\n</ul>\r\n</dd></dl>\r\n</p>',	'',	1,	0,	0,	7,	'2011-01-12 17:08:51',	42,	'',	'2011-01-20 10:10:47',	42,	0,	'0000-00-00 00:00:00',	'2011-01-12 17:08:51',	'0000-00-00 00:00:00',	'',	'',	'{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',	3,	0,	5,	'',	'',	1,	83,	'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',	0,	'*',	''),
(4,	36,	'Chrome frame',	'chrome-frame',	'',	'<p>Google Chrome Frame is a retort of Google company to Internet Explorer browser which is still widely popular, despite the fact that its rendering engine remains fallen behind other internet browsers. By applying this plug-in, users can benefit from Webkit engine capabilities and, at the same time, do not loose the opportunity of using Internet Explorer interface. To make this interesting solution work, an appropriate \"meta name\" has to be implemented into the head section of the visited page.</p>\r\n<p>In accordance with that, our template contains an appropriate option in its settings that helps the user to switch the meta name in the head section, so that all IE users that have Google Chrome Frame plug-in installed will be able to see the web site along with all facilities offered by Webkit rendering engine.</p>\r\n<p>To get know more about Google Chrome Frame, please visit:</p>\r\n<p><a href=\"http://code.google.com/intl/en-GB/chrome/chromeframe/\">http://code.google.com/intl/en-GB/chrome/chromeframe/</a> - the official Projects web side containing the link to the plug-in.</p>\r\n<p><a href=\"http://www.chromium.org/developers/how-tos/chrome-frame-getting-started\">http://www.chromium.org/developers/how-tos/chrome-frame-getting-started</a> - more info about Google Chrome Frame for developers.</p>',	'',	1,	0,	0,	7,	'2011-01-12 17:12:21',	42,	'',	'2012-01-27 19:16:36',	42,	42,	'2012-02-27 20:34:33',	'2011-01-12 17:12:21',	'0000-00-00 00:00:00',	'{\"image_intro\":\"images\\/chrome-logo1.png\",\"float_intro\":\"right\",\"image_intro_alt\":\"Google Chrome Frame\",\"image_intro_caption\":\"Google Chrome Frame\",\"image_fulltext\":\"images\\/chrome-logo1.png\",\"float_fulltext\":\"right\",\"image_fulltext_alt\":\"Google Chrome Frame\",\"image_fulltext_caption\":\"Google Chrome Frame\"}',	'{\"urla\":\"http:\\/\\/www.google.com\",\"urlatext\":\"Google\",\"targeta\":\"\",\"urlb\":\"http:\\/\\/code.google.com\\/intl\\/en-GB\\/chrome\\/chromeframe\\/\",\"urlbtext\":\"Official Project Site\",\"targetb\":\"\",\"urlc\":null,\"urlctext\":\"\",\"targetc\":\"\"}',	'{\"show_title\":\"0\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}',	4,	0,	4,	'',	'',	1,	112,	'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',	1,	'*',	''),
(5,	38,	'Menu types',	'menu-types',	'',	'<p>Our template supports three menu types:</p>\r\n<ul>\r\n<li>GK menu</li>\r\n<li>Dropline menu</li>\r\n<li>Split menu</li>\r\n</ul>\r\n<p>Each of these menus has different characteristic. It is important to know that in order to gain an additional functionality offered by \"GK menu\", a user has to install a plug-in which can be found in the rest-files package of a particular template.</p>',	'',	1,	0,	0,	8,	'2011-01-12 17:58:21',	42,	'',	'2011-01-12 18:16:21',	42,	0,	'0000-00-00 00:00:00',	'2011-01-12 17:58:21',	'0000-00-00 00:00:00',	'',	'',	'{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',	2,	0,	2,	'',	'',	1,	92,	'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',	0,	'*',	''),
