(23,	63,	'IE 6 style',	'ie-6-style',	'',	'<p>Internet Explorer 6 is on the way out, but there is still a significant number of users that are stuck to this browser. According to this, we decided that our templates are going to support IE 6 slightly. By dint of the \"IE6 Bar\" plug-in, available in templates menu options, users can apply the upper bar in their IE browser to keep them informed that Internet Explorer can not display the Web site properly. Additionally, instead of the whole range of template styles, we created one style- Universal Internet Explorer 6 CSS - project\'s website. Thanks to this, users will have the full access to the webs content, but on the other hand, a web sites appearance and functioning might be more rough to some extend.</p>',	'',	1,	0,	0,	7,	'2011-01-17 14:47:32',	42,	'',	'0000-00-00 00:00:00',	0,	0,	'0000-00-00 00:00:00',	'2011-01-17 14:47:32',	'0000-00-00 00:00:00',	'',	'',	'{\"show_title\":\"\",\"link_titles\":\"\",\"show_intro\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"alternative_readmore\":\"\",\"article_layout\":\"\"}',	1,	0,	2,	'',	'',	1,	27,	'{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}',	1,	'*',	''),
